import React from "react";
import ReactDOM from "react-dom";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import HighChartsMore from "highcharts/highcharts-more";
function DevopsChart() {
    var treemap = require('highcharts/modules/treemap')
    HighChartsMore(Highcharts)
    let options = {
        series: [{
            type: "treemap",
            layoutAlgorithm: 'stripes',
            alternateStartingDirection: true,
            levels: [{
              level: 1,
              layoutAlgorithm: 'sliceAndDice',
              dataLabels: {
                enabled: true,
                align: 'left',
                verticalAlign: 'top',
                style: {
                  fontSize: '15px',
                  fontWeight: 'bold'
                }
              }
            }],
            data: [{
              id: 'A',
              name: 'Apples',
              color: "#EC2500"
            }, {
              id: 'B',
              name: 'Bananas',
              color: "#ECE100"
            }, {
              id: 'O',
              name: 'Oranges',
              color: '#EC9800'
            }, {
              name: 'Anne',
              parent: 'A',
              value: 5
            }, {
              name: 'Rick',
              parent: 'A',
              value: 3
            }, {
              name: 'Peter',
              parent: 'A',
              value: 4
            }, {
              name: 'Anne',
              parent: 'B',
              value: 4
            }, {
              name: 'Rick',
              parent: 'B',
              value: 10
            }, {
              name: 'Peter',
              parent: 'B',
              value: 1
            }, {
              name: 'Anne',
              parent: 'O',
              value: 1
            }, {
              name: 'Rick',
              parent: 'O',
              value: 3
            }, {
              name: 'Peter',
              parent: 'O',
              value: 3
            }, {
              name: 'Susanne',
              parent: 'Kiwi',
              value: 2,
              color: '#9EDE00'
            }]
          }],
          title: {
            text: 'Fruit consumption'
          }
    }


    return (
        <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
    )
}

export default DevopsChart;

